import { StyleSheet } from "react-native";

export const styles = StyleSheet.create({
    container: {
        width: '100%',
        padding: 10
    },
    button: {
        backgroundColor: 'white',
        height: 48,
        justifyContent: 'center',
        alignItems: 'center',
        borderRadius: 20
    },
    cusBtnText: {
        fontSize: 12,
        fontWeight: 'bold',
        textTransform: 'uppercase',
    }
})
